import React, { useState } from "react";

const SideBar = () => {
  const [state, setState] = useState([
    { id: 1, image: "/images/pic1.jpg", name: "Gabriel Vásquez" },
    { id: 2, image: "/images/pic2.jpg", name: "COVID-19: Centro de Información" },
    { id: 3, image: "/images/pic3.jpg", name: "Páginas" },
    { id: 4, image: "/images/pic4.jpg", name: "Amigos" },
    { id: 5, image: "/images/imran1.jpg", name: "Messenger" },
    { id: 6, image: "/images/imran2.jpg", name: "MarketPlace" },
    { id: 7, image: "/images/imran2.jpg", name: "Videos" },
    { id: 8, image: "/images/imran2.jpg", name: "Grupos" },
    { id: 9, image: "/images/imran2.jpg", name: "eventos" },
    { id: 10, image: "/images/imran2.jpg", name: "Ver más" },
  ]);
  return (
    <div className="sidebar">
      {state.map((info) => (
        <div className="sidebar__list" key={info.id}>
          <div className="sidebar__list-img">
            <img src={info.image} alt="group image" />
          </div>
          <div className="sidebar__list-name">{info.name}</div>
        </div>
      ))}
    </div>
  );
};

export default SideBar;
